CREATE PROCEDURE spDel_Cg_movimento_equipamento_item	@ID_ROMANEIO As int,	@UNIQUE_KEYID As uniqueidentifierASBEGINDELETE FROM CG_MOVIMENTO_EQUIPAMENTO_ITEM WHERE	ID_ROMANEIO = @ID_ROMANEIO AND	UNIQUE_KEYID = @UNIQUE_KEYIDEND------------------------------------------------------------